[{'comment_id': 655731781, 'comment_body': "It appears the organization you've gone with is this:
```
## Parameters

{generate_api_arguments_table|zulip.yaml|/realm/playgrounds:post}

{generate_parameter_description(/realm/playgrounds:post)}

## Response

{generate_return_values_table|zulip.yaml|/realm/playgrounds:post}

{generate_response_description(/realm/playgrounds:post)}
```

What's the thinking behind the response descriptions sitting after the table of parameters?  

It appears the actual docs have a mix of both styles.  I'll look at the examples and think about this.", 'comment_created': datetime.datetime(2021, 6, 21, 21, 58, 49, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 655747664, 'comment_body': 'I think after playing with this, the approach of a note at the end is probably fine. Posted detailed comments on individual items in the other PR.', 'comment_created': datetime.datetime(2021, 6, 21, 22, 35, 27, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 655756172, 'comment_body': "> It appears the organization you've gone with is this:
> 
> ```
> ## Parameters
> 
> {generate_api_arguments_table|zulip.yaml|/realm/playgrounds:post}
> 
> {generate_parameter_description(/realm/playgrounds:post)}
> 
> ## Response
> 
> {generate_return_values_table|zulip.yaml|/realm/playgrounds:post}
> 
> {generate_response_description(/realm/playgrounds:post)}
> ```
> 
> What's the thinking behind the response descriptions sitting after the table of parameters?
> 
> It appears the actual docs have a mix of both styles. I'll look at the examples and think about this.

@timabbott  In addition to the already existing examples, I feel that we would more likely want to talk about common elements about parameters/responses after mentioning them all for the context, and hence the decision. Further, the already existing cases where descriptions occur before seem to be easily adjustable to the other format.", 'comment_created': datetime.datetime(2021, 6, 21, 22, 57, 19, tzinfo=datetime.timezone.utc), 'commenter': 'MSurfer20', 'type': 'User'}, {'comment_id': 656455705, 'comment_body': "Yeah, I think this is fine for now.  It might be better writing style to have these at the top in many cases, but we'll need to rewrite the text to do so, and the goal here is to migrate to a world where it'd be easy to just edit the default/base template anyway.", 'comment_created': datetime.datetime(2021, 6, 22, 17, 56, 27, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 656457337, 'comment_body': 'I think it would be well worth deduplicating these extensions as a follow-up PR.  The `run` code is the same for all of these aside from the regex and the `render` function, so I think we could have a base class that we subclass with different render functions and `REGEX` properties and delete a lot of duplicate code.', 'comment_created': datetime.datetime(2021, 6, 22, 17, 57, 56, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 656573358, 'comment_body': '@MSurfer20, any particular reason to choose `531` as the priority number? As I can see that priority number 531 is already used by `APITitlePreprocessor`. And AFAIK, we keep these priority numbers distinct.
@timabbott can confirm this.', 'comment_created': datetime.datetime(2021, 6, 22, 20, 55, 47, tzinfo=datetime.timezone.utc), 'commenter': 'akshatdalton', 'type': 'User'}]

[{'comment_id': 569827552, 'comment_body': 'How did you pick 1.12em?  

@amanagr FYI in case you have a suggested value for this.

(Also, does the `line-height` need to change in a corresponding way?)', 'comment_created': datetime.datetime(2021, 2, 3, 23, 36, 35, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 569879162, 'comment_body': 'I did not suggest a value for this, but 16px looks like a good enough value for both line-height and font-size. 1.12rem (~18px) is excessive..', 'comment_created': datetime.datetime(2021, 2, 4, 1, 29, 37, tzinfo=datetime.timezone.utc), 'commenter': 'amanagr', 'type': 'User'}, {'comment_id': 571175124, 'comment_body': '16px seems reasonable to me.', 'comment_created': datetime.datetime(2021, 2, 5, 18, 43, 38, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 571216843, 'comment_body': '@timabbott I had chosen 1.12em as it corresponded to 18px AFAIR. 16px does look better, and i have modified the PR.', 'comment_created': datetime.datetime(2021, 2, 5, 19, 59, 15, tzinfo=datetime.timezone.utc), 'commenter': 'MSurfer20', 'type': 'User'}, {'comment_id': 571310872, 'comment_body': 'It makes no sense for the `line-height` to be less than the `font-size`. And the current font stack here is `Monaco,Menlo,Consolas,"Courier New",monospace`; while replacing it with the generic `monospace` alias might look better on your system, its going to look worse on others.', 'comment_created': datetime.datetime(2021, 2, 5, 23, 47, 53, tzinfo=datetime.timezone.utc), 'commenter': 'andersk', 'type': 'User'}, {'comment_id': 571613974, 'comment_body': 'Thanks for the review @andersk ! Made the required changes.', 'comment_created': datetime.datetime(2021, 2, 7, 13, 0, 14, tzinfo=datetime.timezone.utc), 'commenter': 'MSurfer20', 'type': 'User'}]

[{'comment_id': 602947902, 'comment_body': "This couple lines seem to be buggy; I'm not sure how an OpenAPI parser reads this and thus whether we could reasonably expect our tooling to have caught this.", 'comment_created': datetime.datetime(2021, 3, 28, 23, 15, 27, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 602948686, 'comment_body': "It appears that `prettier` re-adds this bug if one fixes it manually, so there's something more complicated going on here.

@andersk FYI in case you have any ideas.", 'comment_created': datetime.datetime(2021, 3, 28, 23, 21, 36, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 602997414, 'comment_body': "@timabbott According to https://stackoverflow.com/questions/33987316/what-is-a-complex-mapping-key-in-yaml#:~:text=On%20the%20YAML%20specs%20there,%2C%20colon%2C%20or%20question%20mark. it is a valid yaml syntax. I think Prettier is changing the syntax because of the length of the key(it doesn't change the syntax if I reduce the length of the key), but I'm not sure why it hadn't happened for the same key earlier in documentation.
Also, this had to be changed to `message_content_allowed_in_email_notifications` from `realm_message_content_allowed_in_email_notifications` but it missed by eye because of the different syntax and resulting non-highlighting. Apologies!", 'comment_created': datetime.datetime(2021, 3, 29, 3, 43, 12, tzinfo=datetime.timezone.utc), 'commenter': 'MSurfer20', 'type': 'User'}, {'comment_id': 603000428, 'comment_body': '@timabbott This is indeed happening due to the long property name(along with the preceding tabs) as per https://github.com/prettier/prettier/issues/5599. A workaround could be modifying the Prettier config file to allow longer length?', 'comment_created': datetime.datetime(2021, 3, 29, 3, 55, 26, tzinfo=datetime.timezone.utc), 'commenter': 'MSurfer20', 'type': 'User'}, {'comment_id': 603015794, 'comment_body': "Hmm, if it works, I'm OK with it.  Perhaps the right actual fix might be to move some of this content to be in a component, so that it isn't so deeply intended.", 'comment_created': datetime.datetime(2021, 3, 29, 5, 4, 36, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}, {'comment_id': 603016042, 'comment_body': "Though it is a bit puzzling that if we make this line wrong (with the `realm_` prefix), the tests don't fail.  ", 'comment_created': datetime.datetime(2021, 3, 29, 5, 5, 38, tzinfo=datetime.timezone.utc), 'commenter': 'timabbott', 'type': 'User'}]
